var gameplayControls = [
  "ArrowUp",
  "ArrowRight",
  "ArrowDown",
  "ArrowLeft",
  "g"
];
var uiControls = ["Escape", "c", "i", "k", "l", "Shift"];
var lookingControls = ["ArrowUp", "ArrowRight", "ArrowDown", "ArrowLeft"];
var inventoryControls = [
  "ArrowUp",
  "ArrowRight",
  "ArrowDown",
  "ArrowLeft",
  "d",
  "g",
  "q",
  "r",
  "w"
];
var processUserInput = (world) => {
  const {userInput, mode, pcEnts} = getState();
  const {key} = userInput;
  if (key === "Escape") {
    setState((state2) => {
      state2.mode = "GAME";
    });
  }
  if (key === "c") {
    setState((state2) => {
      state2.mode = "CHARACTER_MENU";
    });
  }
  if (key === "i") {
    setState((state2) => {
      state2.mode = "INVENTORY";
    });
  }
  if (key === "k") {
    setState((state2) => {
      state2.mode = "LOOKING";
    });
  }
  if (key === "l") {
    setState((state2) => {
      state2.mode = "LOG";
    });
  }
  if (["LOOKING"].includes(mode)) {
    if (lookingControls.includes(key)) {
      setState((state2) => {
        state2.userInput = userInput;
      });
    }
  }
  if (["INVENTORY"].includes(mode)) {
    if (inventoryControls.includes(key)) {
      setState((state2) => {
        state2.userInput = userInput;
      });
      const pcEid = pcEnts[0];
      let nItems = 0;
      walkInventoryTree(world, pcEid, Inventory, () => {
        nItems++;
      });
      const currentLocId = `${Position.x[pcEid]},${Position.y[pcEid]},${Position.z[pcEid]}`;
      const entitiesInReach = gettableEntitiesInReach(world, currentLocId);
      const {inventory} = getState();
      if (key === "ArrowUp") {
        if (inventory.columnIndex <= 0) {
          if (inventory.inventoryListIndex === 0) {
            setState((state2) => {
              state2.inventory.inventoryListIndex = nItems - 1;
            });
          } else {
            setState((state2) => {
              state2.inventory.inventoryListIndex--;
            });
          }
        }
        if (inventory.columnIndex === 2) {
          if (inventory.inReachListIndex === 0) {
            setState((state2) => {
              state2.inventory.inReachListIndex = entitiesInReach.length - 1;
            });
          } else {
            setState((state2) => {
              state2.inventory.inReachListIndex--;
            });
          }
        }
      }
      if (key === "ArrowDown") {
        if (inventory.columnIndex === 0) {
          if (inventory.inventoryListIndex >= nItems - 1) {
            setState((state2) => {
              state2.inventory.inventoryListIndex = 0;
            });
          } else {
            setState((state2) => {
              state2.inventory.inventoryListIndex++;
            });
          }
        }
        if (inventory.columnIndex === 2) {
          if (inventory.inReachListIndex === entitiesInReach.length - 1) {
            setState((state2) => {
              state2.inventory.inReachListIndex = 0;
            });
          } else {
            setState((state2) => {
              state2.inventory.inReachListIndex++;
            });
          }
        }
      }
      if (key === "ArrowLeft") {
        if (inventory.columnIndex === 0) {
          setState((state2) => {
            state2.inventory.columnIndex = 2;
          });
        } else {
          setState((state2) => {
            state2.inventory.columnIndex = 0;
          });
        }
      }
      if (key === "ArrowRight") {
        if (inventory.columnIndex === 2) {
          setState((state2) => {
            state2.inventory.columnIndex = 0;
          });
        } else {
          setState((state2) => {
            state2.inventory.columnIndex = 2;
          });
        }
      }
      if (key === "d") {
        if (inventory.columnIndex === 0) {
          drop(world, pcEid, inventory.selectedInventoryItemEid);
        }
      }
      if (key === "q") {
        if (inventory.columnIndex === 0) {
          quaff(world, pcEid, inventory.selectedInventoryItemEid);
        }
      }
      if (key === "r") {
        if (inventory.columnIndex === 0) {
          const wielder = getWielder(world, pcEid, inventory.selectedInventoryItemEid);
          if (wielder) {
            unwield(world, wielder[0]);
          }
        }
      }
      if (key === "w") {
        if (inventory.columnIndex === 0) {
          wield(world, pcEid, inventory.selectedInventoryItemEid);
        }
      }
      if (key === "g") {
        if (inventory.columnIndex === 2) {
          get(world, pcEid, inventory.selectedInReachItemEid);
        }
      }
    }
  }
  if (["GAME"].includes(mode)) {
    if (gameplayControls.includes(key)) {
      setState((state2) => {
        state2.userInput = userInput;
      });
    }
  }
  if (uiControls.includes(key)) {
    setState((state2) => {
      state2.turn = "PLAYER";
    });
  } else if (uiControls.includes(userInput)) {
    setState((state2) => {
      state2.turn = "UI";
    });
  } else {
    setState((state2) => {
      state2.turn = "WORLD";
    });
  }
};

